import React from "react";
import styles from "./Table.module.css";
import RowTable from "./RowTable";

const Table = (props) => {
  return (
    <div className={styles.table}>
      <RowTable />
      <RowTable />
      <RowTable />
    </div>
  );
};

export default Table;
